import axios from 'axios';


interface SignUpInfo {
    emailAddress: string;
    userPassword: string;
    fullName: string;
    university: number;
    course: string;
    yearOfStudy: number;
}

var data = JSON.stringify({"name":"John Yeo","email":"j.yeoss@u.nus.edu","password":"sOmEpAsSwOrD","schoolId":"5f9656274c30e3752780805f","courseId":"5f9656274c30e37527808065","currentYear":4});
function signUp (values: SignUpInfo) {
    console.log("Service received");
    console.log(values)
    var config = {
        method: 'post',
        url: 'http://localhost:8080/api/user',
        headers: { 
          'Content-Type': 'application/json'
        },
        data : data
      };

      axios(config)
      .then(function (response) {
        console.log(JSON.stringify(response.data));
      })
      .catch(function (error) {
        console.log(error);
      });
}

export default {
    signUp
}
